import styled from "styled-components";

export const HomePageContainer = styled.div`
  position: relative;
  display: flex;
  flex-direction: column;
  margin-left: auto;
  margin-right: auto;
  max-width: 1500px;
  background-color: #eaeded;
  border: blue 1px solid;
`;
